import React from 'react'

function App() {
  const url="https://randomuser.me/api";
  const peticion=fetch(url);
  peticion
  .then(datos=>datos.json())
  .then(lectura=>console.log(lectura.results[0].name))
  .catch(()=>console.log("Error"))



  return (
    <div>App</div>
  )
}

export default App
